  [],\n\t\"num_tags\": 0,\n\t\"name\": \"nodc-standard-format-marine-mammals-of-coastal-alaska-data-1975-1981-marine-mammal-specimens-f0\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NODC maintains data in three NODC Standard
  Format Marine Mammal DatanSets: Marine Mammal Sighting and Census (F127); Marine
  Mammal Specimensn(F025); Marine Mammal Sighting 2 (F026). These data type formats
  arendesigned to support studies of biological populations and ecosystemsnthat are
  subject to impact from oil and gas development, marinenpollution and other environmental
  disturbances. Information on marinenanimal populations, activities, migratory routes
  and breeding localesnare obtained from either surface ship or aircraft surveys.nnThe
  Marine Mammal Specimens (F025) data type contains data fromnexaminations of marine
  mammal specimens. The data are collected tondefine behavior, population dynamics
  and trophic relationships of marinenmammals. In addition to species, position, time
  and environmentalnconditions at the collection site, data for each specimen may
  includenweight and body dimensions, sex and reproductive status, age, primaryncause
  of death and analysis of stomach contents. The species of both thenspecimen and
  its ingested prey are encoded using the NODC TaxonomicnCode. Comments may be reported
  in a free-text record. F025 contains datanfor 1975 - 1981. For further information
